                </div>

                <div>
                    <img src="" alt="Avatar" />
                    <h1>Raphael <br/> Hinostroza </h1>
                </div>

                <div>
                    <p>Frontend Engineer</p>
                    <p>@hinostroza</p>
                </div>


            </div>
        );
    }
}

export default Badge;
